import React from 'react';
import {  Button, Checkbox, Icon, List, Table } from 'semantic-ui-react';
import '../../../../app/layout/DashboardLayout/styles.css';
import { ISector } from '../../../../app/models/sector';
interface IProps {
  sectors: ISector[];
  // selectActivity: (id: string) => void;
  // deleteActivity: (id: string) => void;
}

const SectorList: React.FC<IProps> = ({
  sectors
  // selectActivity,
  // deleteActivity
}) => {
  return (
    <div>
      <Table celled inverted selectable>
        <Table.Header fullWidth >
          <Table.Row  >
            <Table.HeaderCell>Sector Name</Table.HeaderCell>
            <Table.HeaderCell>Options</Table.HeaderCell>
          </Table.Row>
        </Table.Header>

        <Table.Body>
          {sectors.map((sector) => (
            <Table.Row positive key={sector.sectorId}>
              <Table.Cell >{ sector.sectorName}</Table.Cell>
              <Table.Cell colSpan="2">
                <Button.Group>
                  <Button>Edit</Button>
                  <Button.Or />
                  <Button negative>Delete</Button>
                </Button.Group>
              </Table.Cell>
            </Table.Row>
          ))}
        </Table.Body>

        <Table.Footer fullWidth>
          <Table.Row>
            <Table.HeaderCell colSpan="15">
              <Button
                floated="right"
                icon
                labelPosition="left"
                primary
                size="small"
              >
                <Icon name="product hunt" /> Add Sector
              </Button>
            </Table.HeaderCell>
          </Table.Row>
        </Table.Footer>
      </Table>
    </div>
  );
};

export default SectorList;
